import React from 'react';
import { TextField } from '@mui/material';

const OtherCost = ({ value, onChange, showError, errorMessage, }) => {
  const handleChange = (e) => {
    const newValue = e.target.value;
    onChange(newValue);
  };
  return (
    <div>
      <TextField
        value={value}
        onChange={handleChange}
        variant="outlined"
        size="small"
        fullWidth
        type="number"
        placeholder="Другие"
        style={{ width: '140px' }} // Увеличиваем ширину на 10%
      />
    </div>
  );
};

export default OtherCost;
